// Headeruser.jsx
import React from 'react';

function Headeruser() {
  return (
    <div style={{
      width: '100%',
      height: '320px',
      backgroundColor: '#f5f7fa', // Couleur gris très clair, sobre
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      flexDirection: 'column',
      color: '#333', // Texte gris foncé
      textAlign: 'center',
      borderBottom: '2px solid #d1d9e6', // Ligne discrète pour séparer
      boxShadow: '0 2px 6px rgba(0, 0, 0, 0.05)',
    }}>
      <h1 style={{ margin: 0, fontSize: '2.2rem', fontWeight: '600' }}>
        Espace Personnel
      </h1>
      <p style={{ fontSize: '1rem', marginTop: '10px', color: '#555' }}>
        Modifier mes informations personnelles
      </p>
    </div>
  );
}

export default Headeruser;
